            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>A quick park and find located along a fairly busy section of rural Missouri Highway.\u00a0 Muggles could be heavy depending on the time of day so some discretion may be needed.\u00a0</p>\nOh yeah, watch that poison ivy!"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p><tt>Juniperus virginiana is a dense slow-growing coniferous evergreen tree that may never become more than a bush on poor soil, but is ordinarily from 16\u201366\u00a0ft (rarely to 89\u00a0ft) tall, with a short trunk 12\u201339\u00a0in (rarely 67\u00a0in) diameter. The oldest tree reported, from Missouri was 795 years old. The bark is reddish-brown, fibrous, and peels off in narrow strips. The leaves are of two types; sharp, spreading needle-like juvenile leaves 2.0\u20133.9\u00a0in long, and tightly adpressed scale-like adult leaves 0.079\u20130.16\u00a0in long.<br />\n<br />\nIt is a pioneer invader, which means that it is one of the first trees to repopulate cleared, eroded, or otherwise damaged land. It is unusually long lived among pioneer species, with the potential to live over 850 years. The tree is commonly found in prairies or oak barrens, old pastures, or limestone hills, often along highways and near recent construction sites.\u00a0 This cache is located in the vicinity of one of these trees.\u00a0</tt><br />\n\u00a0</p>"
            }, 
