                    "#text": "Three for Thirty-Seven #1 (5:20 PM)\n\nHaving completed a decent bicycle ride earlier in the day, heading out for a few caches seemed like a good way to round out the afternoon.  Traffic was somewhat heavy but manageable leaving Columbia on highway 63.  How curious!  Turning off to a very familiar road, I soon parked close to the coordinates.  The cache was in hand within minutes and its log signed.  Onward to the next!"
