                  "groundspeak:type": "Found it", 
                  "groundspeak:finder": {
                    "@id": "475837", 
                    "#text": "wrenberlin"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "If I\u2019m learning anything about Missouri, it is that she likes to surprise when it comes to weather. Today, November Ghost, the geo-pibble and myself were graced with gloriously clear skies. It was chilly, but nothing we couldn\u2019t handle! From Columbia, we made a large northern and western loop, with our main goals being to visit the Slurpin\u2019 Soup and Watchin\u2019 Eagles geo-event, add a few new counties to my map, and cache around Hannibal. Our trip took us to an abandoned house, an old bridge in a ghost town, a frozen spring by an icy river, and a treacherous (okay, only slightly) jaunt in the Jeep by a creek bed. Overall, it was an awesome day \u2013 one of those that remind you why geocaching is so much fun.\n\nThis was our last find of the night, and we worked for it! I was almost ready to call it when I spotted the well-camouflaged cache. I traded out TBs after signing the log. Thanks for the cache!"
                  }
