                  "groundspeak:finder": {
                    "@id": "561623", 
                    "#text": "Arthur & Trillian"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "OCW dphickey and Tony Banks on what can only be described as a near-perfect day after Christmas! I am not gonna lie...we had a lot of fun, toured the northern reaches of our area and found some great caches. This is why I like caching...spending time with people, sharing common interests and a sense of adventure! What an awesome way to spend some time with awesome folks!\n\nDropped off four TBs. This cache was signed as TAD for our group. TNLN/SL Thanks, %OwnerName, for placing this cache and for the fun!\n\n-Fulton, MO"
                  }
