                    "@encoded": "False", 
                    "#text": "In an effort to get to 1000 finds at the annual SLAGA Christmas party, I needed to rack up some numbers. And I wanted an adventure while doing it, so I chose to head for Hannibal! Never been there, much less cached there. This one started off my day of 3 dozen! I had no trouble finding it and decided the TB inside needed to travel with me for a while. Thanks!"
