              "@html": "False", 
              "#text": "Cache is a magnetic key box at a location that \"called out to me\" when I was on my way home from a day of caching in Moberly.   I heard \"the call\", turned around, found the spot, studied the area and placed this little sucker for all to enjoy.   There is a smiley face and a ladybug charm for the FTF."
