                  "groundspeak:date": "2013-11-16T20:00:00Z", 
                  "groundspeak:type": "Found it", 
                  "groundspeak:finder": {
                    "@id": "348127", 
                    "#text": "Muffkin42 X 2"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "Hi all,\nVERY good (\"play on Words OR letters\").. \nWe're on our way home to see what's happening.. We need to be home, and prepare for the Veteran's 4th Annual, Lighted Christmas Parade, in Vinton, IA., the Thursday evening (6 PM)(it's DARK), before Thanksgiving.. (The VFW and AmVets got this Parade started four years ago).. Our Veterans Foreign Wars (VFW), American Veterans (AmVets), American Legion, and Vinton's Vol. Fire Dept., all get together for this Parade.. LOTS of business owners put in their lighted \"floats\", etc. Really a VERY Pretty Parade, with all the Christmas lighted entries.. We even have some antique cars and trucks, in the parade.....\nBTW, we want to THANK YOU, for your Cache(s) and maybe one day we'll BCNU down the road..\nMuffkin42 X 2 (MSgt/Ret. & Vietnam Vet)\nRon & Carol\n.[8D]..&...[8)]\nVinton, IA."
                  }
