                    "#text": "(#3,264) Out caching my way to Geocoinfest in Omaha, Nebraska today with Swelgus and Jans03. We were specifically aiming for caches that would add new Missouri counties for one or all of us. This one was a new one for me. \n\nFor no good reason at all\u2026 this one took us a few minutes to find. It was right where you'd expect it to be\u2026 but we were busy looking in other places you'd expect it to be. Finally\u2026 it was found and we put our \"SLAGA 3\" signature on the log. Thanks for a find we made harder than we should have\u2026 and for the new county on my map, twilight rabbit!"
