                  "groundspeak:finder": {
                    "@id": "1572075", 
                    "#text": "Boreal Walker"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "What to do when you have a weekend to yourself?  Go caching of course.  I loaded up the geodogs and went on a 1300-mile roadtrip to Kansas City and back.  I had to primary goals for this trip: Find the KCI geoart and complete the Iowa County Seat Challenge on the way home.  I had a secondary goal of finding a few new counties in Missouri and Kansas.  I am happy to report I was successful.  Along the way I kept an eye out for ghost caches, high favorite points, and challenges.  I got a good tour of the KC metro area on this trip.  Always nice to see the off the beaten path stops.  I even managed to get eight icons on Saturday.  I am sure that will help me with a challenge somewhere along the route.  Thanks for the hospitality.  I pulled in to town to get a second cache in this county.  Lucky for me the wasp were gone.  XNSL TFTC"
                  }
