                    "#text": "7:05 pm\nFound this one with rilekyle while working on some northern Missouri counties. TFTC!\n\nThis entry was edited by brigantia on Sunday, 24 August 2014 at 19:40:03 UTC.\n\nThis entry was edited by brigantia on Sunday, 24 August 2014 at 19:42:05 UTC."
