            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<br />\n<table width=\"76%\" border=\"0\" cellspacing=\"4\" cellpadding=\"2\">\n<tr valign=\"top\">\n<td width=\"190\" rowspan=\"4\" align=\"center\" bgcolor=\"#999966\">\n<h2 align=\"center\">Missouri</h2>\n<img src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/a/ac/Flag_of_Missouri.svg/744px-Flag_of_Missouri.svg.png\" width=\"187\" height=\"120\" />\n<p align=\"left\">Capital: Jefferson City</p>\n<p align=\"left\">Largest City: Kansas City</p>\n<p align=\"left\">Size Rank: 21st</p>\n<p align=\"left\">Population Rank: 17th</p>\n<p align=\"left\">Admission to Union: 24th</p>\n<p align=\"left\">\u00a0</p>\n<p align=\"left\">Find the other caches in the series <a href=\"http://www.geocaching.com/bookmarks/view.aspx?guid=9bbb6655-e2ef-459b-80f6-66a9decd9d41\">HERE</a>.</p>\n<p align=\"center\">\u00a0</p>\n</td>\n<td width=\"693\" height=\"48\" align=\"center\" valign=\"middle\" bgcolor=\"#FFFFFF\">\n<h1 align=\"center\" class=\"style1\"><img src=\"http://img.geocaching.com/cache/166de36d-345c-48ac-a95b-898064ff2c2c.jpg\" width=\"450\" height=\"221\" /></h1>\n</td>\n</tr>\n<tr>\n<td bgcolor=\"#99CC99\">\n<p><strong>The Cache Across America Series:</strong> This is a series of caches that will take you on a caching tour of the entire United States. One cache is hidden in each of the 50 states. These caches each contain a numeric clue that will lead you to <a href=\"http://www.geocaching.com/bookmarks/view.aspx?guid=68e2d17a-8ae9-45c9-9516-0e45694cc2d7\">one final cache</a> located in our nation's capitol upon completion of the series.</p>\n</td>\n</tr>\n<tr>\n<td height=\"61\" bgcolor=\"#FFFFFF\">\n<p><strong>About this cache:</strong> Missouri is the home of many influential people and places.<br />\n<br />\nFrom the trading post in St Louis to the Garment District in Kansas City, Missouri was a major center of trade. The Garment District was second only to New York City in number of clothing manufacturers in the 1930's. The Kansas City stockyards routed 2,631,808 cattle through its yards in 1923, in addition to hogs, mules and horses, making it second only the the Chicago yards in number of transactions. St Louis was founded in 1764 by Pierre Lacl\u00e8de Liguest and for many years was the center of trade for the states along the Mississippi and Missouri rivers. These two rivers have a combined basin of 689,000 square miles encompassing almost 42% of the land area of the coterminous United States. Missouri is also famous for it\u2019s Missouri Foxtrotters,(a fine mule) and it has been a major supplier of mules to the USA and foreign countries for over 150 years.<br />\n<br />\nMany famous people have called Missouri home including Jesse James,Daniel Boone, Harry Truman,George Washington Carver, Samuel Clemens, Laura Ingles Wilder, Maya Angelou,Satchel Paige, John \"Buck\" O\u2019Neil,J.C. Penny, Scott Joplin,General John J. Pershing, General Omar N. Bradley and my personal favorite Walter Elias Disney.<br />\n<br />\nAfter spending several months trying to find a place that best exemplified Missouri I decided that this site was the most fitting. Walt moved to Marceline at the age of four and this was very influential in his design of Disneyland. When he was designing Main Street USA he and his designers used the main street of Marceline as a model. Walt once said \"To tell the truth, more things of importance happened to me in Marceline than ever happened since--or are likely to in the future.\"<br />\n<br />\nThe cache is on private property but it is open to the public. There is parking due south of the cache that is very well marked. Also make sure you check the sign to the east of the parking lot in front of the house for more fun facts.<br />\n<br />\nPlease only do this cache during daylight hours as I have told the owner we would not be out after dark.</p>\n</td>\n</tr>\n<tr>\n<td height=\"61\" bgcolor=\"#CCCCCC\">\n<p><strong>Logging Requirements:</strong> Enjoy this cache as you would any other. If you are searching this cache as a participant in the Cache Across America series, please post a photo of yourself or a member of your group with the cache in your online log. If you for some reason are unable to meet the photo requirement, please make alternate arrangements to verify your find with the individual cache owner. There is no photo requirement for non-challenge participants.</p>\n<p>Individual verification of all 50 state finds will be required before logging the series final.</p>\n<p>If participating in the series, please take note of the three digit code located inside this cache. Save this code in a secure place. When you have visited all 50 caches, and have collected all 50 codes, you are welcome to seek and find the final cache! Good luck!</p>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\">\u00a0</td>\n</tr>\n</table>\n<p>\u00a0</p>"
            }, 
