                    "#text": "Back in the area today so I stopped to drop off a travel bug. The cache had been placed on top of a barrel near entrance door to barn. The hiding spot where I had found it previously had recently been trimmed back. Guess whomever did the trimming found it and moved it. I returned the cache to the likely location and hid with some geoflage."
