                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "Find #10000 @ 8:43:00 AM. \n\n10 of 42 that I found today. \nWent out caching today with the intention of finding my 10,000th cache, and once that goal was accomplished, I just kept caching my way north until the thought of beer brought me back home...\n\nI had no Idea when I found my first geocache 10 years ago that someday, I would wind up with over 10,000 cache finds, cache in 32 states and 2 Canadian Provinces, make many new friends, and have al ot of fun doing this. I cant wait to see what the future holds. I enjoyed wandering around the grounds, reflecting of the setting and the moment. \nSl\n\nThanks webscouter. for the hide!\n\nAwhsom\nOak Grove, MO"
                  }
