                  "groundspeak:finder": {
                    "@id": "4558963", 
                    "#text": "littleblkdog"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "What a great spot for a CAA.  Probably one of the most original I have seen.  Thanks for bringing me here and sharing this spot.  Cache was  an easy find after examining the site.  This was another CAA on an extended trip from Maryland to California by mostly going back and forth along a North or South route. Along the way I racked up over 7700 miles, two weeks in the car and found about half the CAA caches and numerous Year 2000 oldies. Thanks for owning a CAA cache.\n<p>\n<p>This was the 2nd cache find of 3 today with 0 DNF(s) to make 2089 total finds.  Logs were signed as littleblkdog or LBD!  Thanks to webscouter. for the Cache!"
                  }
