                  "groundspeak:finder": {
                    "@id": "1570053", 
                    "#text": "bernsa"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "Find # 0009003\nCounty: Linn, Missouri\nDelorme Grid: MO-022\n\nDay 2 of my Midwest Journey to Geowoodstock XII from Des Moines, IA.  Today I started in Ottumwa, IA with some foggy weather and got into some rather stormy conditions as I made my way into Missouri.  Eventually I punched through a line of thunderstorms while moving west from Edina to Kirksville.  The rest of the day was quite delightful and the weather kept getting better and better before ending in Columbia, MO.  Most of my good friends going to GWS were well on their way to the event and I had hoped to see some on the journey, but I wound up not crossing paths with anyone though I evidently crossed paths with some of my Maryland friends near Macon or Moberly today.  Lots of fun caches to be had today!\n\nMy Nuvi had tried to route me via a rather interesting way to get to this cache, but gladly ignored it as it seemed a better way that didn't involve driving down mysterious non-existent roads and across airport runways was to be had.  Sure enough I got there no problem on my own.  Quick find.  TFTC."
                  }
