                    "#text": "This was my 26th find for a total of 44 for this outing. \n\nI loaded up the road bike and joined over 400 other crazy cyclists to ride across the beautiful state of Missouri in the Big BAM (Bike Across Missouri). We picked the hottest time of the year because we rode in over 100 degrees heat index. But that did not stop me from finding several great caches! I had the GPSr loaded up for each overnight town and for the route I would be riding. \n\nThanx for placing this cache for me to find bsabrook41!"
