            "groundspeak:long_description": {
              "@html": "False", 
              "#text": "This is a small LOG Only cache, bring your own pen.  Easy exit and return to Highway 36 in Beautiful Brookfield Missouri.  Log only cache for now.  BYOP.\nA first for Brookfield, I hope that we can get more in this fine city.  \n\nLooking around it feels that someone in a wheelchair should be able to get to this one.  Pavement all the way, no need to leave the pavement at all.\n\nI had to replace this.  IF you find a pill bottle that is orange, you found the OLD ONE.  The new one is a pill bottle that is covered in camo duct tape.\n\nPlaced with permission of the owner of the property.  If you are thirsty or hungry stop in and tell Tony that you are here!"
            }, 
