            "groundspeak:short_description": {
              "@html": "False", 
              "#text": "This is one of four remaining covered bridges that have been preserved in Missouri.\n\nAccessible from Sunrise to Sundown."
            }, 
            "groundspeak:long_description": {
              "@html": "False", 
              "#text": "The Locust Creek Covered Bridge was built in 1868.  It is the longest of the four surviving covered bridges in Missouri at 151 feet long.  The bridge was built out of white pine using the Howe-truss system, utilizing vertical iron rods to draw the diagonal members tight against the top and bottom of the bridge.  It was situated on the main east-west road in northern Missouri, and served as a link over Locust Creek on America\u2019s first transcontinental road. (Route 8)  In 1930, U. S. Highway 36 replaced Route 8, and after World War II, Locust Creek was channelized and straightened, so that it no longer flowed under the bridge.  Years of floods filled in the old riverbed with silt, which is why it appears that it is spanning an empty field.  In 1991, the bridge was raised six feet  to give it once again the appearance of a bridge and to protect it from wet ground below.\n\nTo log this cache, please email me with a basic explanation as to where in the bridge the structures shown in the pictures are located.  i.e. inside or outside the bridge, on the walls going up and down, across the ceiling, underneath the bridge, etc."
            }, 
