                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "I wasn't expecting the walk to the bridge but it ended up being good because it's such a nice day. I'm glad we stopped and saw it. Thanks for bringing us here. I'll email the answer for Meggiejoy and I later this weekend."
                  }
