                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "Caching my way up Highway 36 and west across Highway 61 from St. Louis to St. Joseph with Pastor G... trying to grab caches in as many counties as we could. I saw this virtual cache pop up on the map and told Pastor G (who was driving) about it. We both were pretty excited to go see a covered bridge... [b]especially[/b] if we could net a virtual cache in the process. What's more... it had a \"24/7\" attribute attached to it... something rather important since it was like 10:00 at night by this point in our trip.\n\nSo we headed down the gravel roads... winding this way and that 'til we got to the parking area for the covered bridge area. And as we pulled into the parking lot... we saw a sign indicating that the hours of visiting the bridge ended at sundown... not quite the \"24/7\" we had been hoping for.\n\nI hope to get back here sometime when we can get to the bridge... but in the meantime... the cache page might should be updated to indicate that the cache isn't available 24/7. Thanks for keeping this virtual cache alive, Kiefer3D!"
                  }
