            "groundspeak:short_description": {
              "@html": "True"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>This is one of three geocaches, for Chip n' Dale, which involves three different towns. Wheeling, LaClede and Brookfield.\u00a0 The chipmunks, Chip and Dale are cartoon characters created in 1943, at Walt Disney Productions. They were named after a famed 18th century cabinet maker, Thomas Chippendale. (per Wikipedia) Wheeling, is the birthplace of Willis Allen \"Bill\" Glasgow (April 21, 1907 \u2013 November 1, 1959). His family moved when he was ten years old to Iowa, where he became a professional football player, winning many awards and using his NFL earnings, to further his education, becoming a lawyer, after his football days.</p>\n<p>You are looking for a large container, wrapped in black tape, that contains swag, pen and log, \u00a0and a travel bug. \u00a0Great spot for more travel bugs to hide. \u00a0Lots of muggles, so please use stealth. \u00a0Be respectful of the residents and please be very careful of the lid and make sure it stays on tight, before replacing cache. \u00a0Replace, as you found it, so it will be kept hidden for the next find. \u00a0</p>\nCongratulations, Seifertgal for being the First to Find!"
            }, 
