                  "groundspeak:finder": {
                    "@id": "561623", 
                    "#text": "Arthur & Trillian"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "GEOCOINFEST!\nGEOCOINFEST!\nGEOCOINFEST!\n\nThis was the rallying cry when I heard that there was going to be an AWESOME Mega Event in the Omaha, Nebraska, area! Now, I don't know about you, but to be able to head to a really great caching area to attend a Mega is a pretty awesome situation!\n\nSo, I made my plans. I knew I was going to drive across Missouri, up to Iowa and over to Nebraska, of course! So I planned...and planned...and planned. I plotted routes, I took caches into consideration. I decided to mainly focus on Earthcaches and Virtuals, but I certainly added others to the mix. If I was going to go on a road trip, I was going to make it fun!\n\nThis was day one of the adventure. It found me beginning at home in Fulton, caching my way along US 36 to St. Joseph and on up to Council Bluffs and finally the Omaha area. I had a lot of fun, that's for sure! My sights were originally set on stopping in St. Jo, but I got done with my route so quickly that I said to heck with it...I'd push on to Omaha!\n\nNaturally, along the way I did some caching, and boy was it fun!\n\nIf there were answers to be sent, they have been sent. Pics will be uploaded where necessary. [;)]\n\nThis cache was the 6th cache of 69 caches on the day. Thanks for placing this cache for myself and others to enjoy! TNLN/SL TFTC!\n\nYes, we know where our towels are...\n\n-Fulton, MO"
                  }
