                  "groundspeak:finder": {
                    "@id": "561623", 
                    "#text": "Arthur & Trillian"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "Today I set out on the first days of epic caching for the Jesse James Cache Bash! I started my day out rather early, but I was rip rarin' to go! I initially had to deal with some rain, but it all cleared up very quickly by the time I got to my first cache. I got a lot of caches today, to say the very least. No matter how many I got today, I had an awesome time just being outdoors and enjoying the weather. This was one of the ones I found, and it helped to create a great experience.\n\nThis cache was the 6th of 113 total caches on the day. TNLN/SL Thanks, 123brimxyz, for placing this cache and for the fun!\n\n-Fulton, MO"
                  }
