            "groundspeak:long_description": {
              "@html": "False", 
              "#text": "My children placed this cache, for me on Mother's Day.  Not only so I could find my gifts, but so I too, could be a cache owner.  Don't be afraid to spend some time visiting this very old place.\n\nParking is at\nN 39 45.455 \nW 092 37.364\n\nYou can drive past the parking coordinates if you have a small vehicle and weather permits.  \n\nPlease be respectful.\n\n\n\n** placed with permission from land owner  **"
            }, 
