            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>P&amp;G<br />\nCity of Maple 1 A.C.E.<br />\nThe City of Maples series The town of Macon was first settled by James T. Haley in 1852. However, long before Mr. Haley's arrival, scores of immigrants from Kentucky and Virginia ventured into the region as early as 1829. In 1872, John Beaumont donated 10,000 young maple trees Because of these 10,000 trees, Macon has been named \"The City of Maples\". The city have seven beautiful and well maintained parks and lakes.</p>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>series 1 of 10 caches. will be in the city parks or around the lakes., around long branch lakes. and some somewhere in the city.\u00a0\u00a0 .</p>\n<p><br />\nCity of Maple 1 A.C.E.</p>\n<p>George Washington appointed the first engineer officers of the Army on June 16, 1775. Long Branch Dam was authorized by Congress in 1965 as a multi-purpose project for water supply, flood control, recreation, downstream water quality and fish/wildlife management. Construction began in 1973 and the dam was placed into operation in 1980. Thank to the rangers for your approval placing this cache</p>"
            }, 
