                    "@encoded": "False", 
                    "#text": "Log was wet. That's what I wrote, but I don't remember which cache this was. 45 caches in a day will do that I suppose.\n\nOCW dphickey and Arthur of Arthur & Trillian on our way to Kirksville from Columbia. Signed most logs as TAD!\n\nThis entry was edited by Tony Banks on Sunday, 28 December 2014 at 05:35:54 UTC."
