                    "#text": "Rolling Hills of Northern Missouri #8 (9:22 AM)\n\nOnce again, a familiar park was encountered wherein Atomic Goat's Breath found a cache I had discovered in the recent past (although in a new spot!).  We proceeded to this hide, and, after correcting an erroneous assumption, the container was in hand.  Signing the log went quickly as the wind was cold and a much warmer environment in the car awaited."
