            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>The City of Maples series The town of Macon was first settled by James T. Haley in 1852. However, long before Mr. Haley's arrival, scores of immigrants from Kentucky and Virginia ventured into the region as early as 1829. In 1872, John Beaumont donated 10,000 young maple trees Because of these 10,000 trees, Macon has been named \"The City of Maples\"</p>\nseries 2 of 10 caches. will be in the city parks or around the lakes., around long branch lakes. and some somewhere in the city."
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>In 1863 the county seat removed from Bloomington to Macon. It took the bill only 48 hours to become law. For their first courthouse in City of Macon , the court appointed Fred Rowland superintendent, who was to present a plan to the court for consideration. They approved the plan March 9, 1864. Levi Aldrich was architect and contractor. In February 1864 the court had appropriated $10,000 from the general fund and ordered that the money be raised by a special tax. After seeing the plan, they appropriated an additional $15,000. Costs ran to approximately $30,000. The county offices moved into the building in September 1865. An annex was added in 1895, costing about $8,500. Today, the 1865 courthouse is a rare example of architecture, representing this turbulent decade of Missouri's history. It has been placed on the National Register of Historic Places.</p>\nThank to the Macon County Commissioners for your approval placing this cache"
            }, 
