            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>P&amp;G<br />\nCity of Maple 11 Stephens</p>\n<p>The City of Maples series The town of Macon was first settled by James T. Haley in 1852. However, long before Mr. Haley's arrival, scores of immigrants from Kentucky and Virginia ventured into the region as early as 1829. In 1872, John Beaumont donated 10,000 young maple trees Because of these 10,000 trees, Macon has been named \"The City of Maples\". The city have seven beautiful and well maintained parks and lakes</p>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>series 8 of 10 caches. will be in the city parks or around the lakes., around long branch lakes. and some somewhere in the city.</p>\n<h3>STEPHENS PROSPERS IN BUSINESS</h3>\n<p>Stephens stayed with the firm five years and decided to try the business on his own. After five years of business he formed a co-partnership with his former employer, E.S. Goldsberry and the firm was called Goldsberry and Stephens. This partnership dissolved after 20 months. Stephens continued in business alone dealing in clothing, hats, caps and gentlemen's furnishings. For a 10 month period Mr. Hail ran the dry goods store. The business was sold to Mr. Hail and Mr. Baker in 1883.</p>\n<p>Stephens had married Anna Cravens of Randolph County. They had 11 children and five lived past birth and childhood: Owen Gordon, Mollie Kiett, Lulie Pearl, Leima and Howard Wendall. His clothing business was the leading house in its line in Macon according to The 1884 History of Macon County. Stephens died December 30, 1892 The park was given to the city on September 6, 1886.:</p>\n<p>Thank to the City of Macon mo for your approval placing this cache</p>\n<p>\u00a0</p>"
            }, 
