                  "groundspeak:date": "2015-07-20T23:25:21Z", 
                  "groundspeak:type": "Temporarily Disable Listing", 
                  "groundspeak:finder": {
                    "@id": "4552", 
                    "#text": "*gln"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "STATUS UPDATE NEEDED\n\nGreetings,\n\nI hate to pop in here like this but from reading the last note or two I see this cache could use a little attention. It is worrisome when a cache with a successful find history has a string of DNF's. The geocaching community would like to know how it's going here. Is your cache still here, its being worked on, that sort of thing. When you get a chance, please log onto your page and give everyone an update by posting a note to your cache page.\n\nI'm temporarily disabling it, to give you an opportunity to stop by and check on the cache.\n\nIf you decide that this project has reached it's end you can archive it to remove it from the active cache database.\n\nWhen everything is OK again, please remember to enable your cache and post an \"Owner Maintenance\" log on your cache page. This log removes the \"needs maintenance\" and allows your cache to be shown in the search results of Pocket Queries. Don't let your cache be filtered out unnecessarily in Pocket Queries by forgetting to re-set the attribute!\n\nI want to thank you for the time that you have taken to contribute to Geocaching in the past and I am looking forward to hopefully seeing your cache up and running in the near future.\n\nHOW TO RESPOND IF YOU HAVE QUESTIONS\n\nRespond by posting a new Note. Go to the cache page in question, and click on Log Your Visit. Select \"Post Note\" as the log type, and enter your message. Doing that, I'll know exactly what cache your message pertains to, which will speed the communication process.\nIf you're reading this as an email, don't reply to the sending address. It won't reach me. Follow the contact instructions above.\nGlenn\n\"Seek quality, not quantity\".\n--\nYour friendly Missouri Geocache Review team is\nGlenn (*gln), Mongo & Banjo-Boy\n\n[size=1][beige]#4a1a1d2559cd5c982ad509e44d011b54[/beige][/size]"
                  }
