                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "Rolling Hills of Northern Missouri #5 (8:59 AM)\n\nHaving started from the south, Atomic Goat's Breath and I reasoned that the best approach for the rest of the series would be to grab what was closest.  This cache was next!  The park's drive was soon zooming by the windows, and, after we turned the car around, entered.  Locating the container took but a moment as we realized that a pattern was forming.  Our names were added to the log (AGB & U!), and the container was returned as found."
                  }
