            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>P&amp;G<br />\nCity of Maple 6 lake Catfish</p>\n\n<p><br />\nThe City of Maples series The town of Macon was first settled by James T. Haley in 1852. However, long before Mr. Haley's arrival, scores of immigrants from Kentucky and Virginia ventured into the region as early as 1829. In 1872, John Beaumont donated 10,000 young maple trees Because of these 10,000 trees, Macon has been named \"The City of Maples\". The city have seven beautiful and well maintained parks and lakes</p>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>Best bets for this lake are Largemouth Bass and Channel Catfish, both species good in size and numbers</p>\n\n<p>Graet place spin time with fanily and friend.</p>\n\n<p> </p>\n\n<p>Thank to the City of Macon mo for your approval placing this cache</p>"
            }, 
