                    "#text": "Denmother and I were OCW Hill Folk from Hannibal to Macon Missouri. We found lots of pieces of this one.  Broken magnetic key holder in one spot, pulp log sheets everywhere, small baggie in another. An obvious victim of the dreaded lawn mower.  We replaced the cache with a small 2-cap container and a new log sheet. All is well. Thanks, paperclip-JK, for placing this cache. \n\n[b] [purple] L Frank and Denmother\nSt. Louis, MO [/purple] [/b]"
