            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p><br />\nP&amp;G<br />\nThe City of Maples series The town of Macon was first settled by James T. Haley in 1852. However, long before Mr. Haley's arrival, scores of immigrants from Kentucky and Virginia ventured into the region as early as 1829. In 1872, John Beaumont donated 10,000 young maple trees Because of these 10,000 trees, Macon has been named \"The City of Maples\". The city have seven beautiful and well maintained parks and lakes 5 of 10</p>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>For bass, I always start with spinnerbaits. Size, color, and blade design are important factors. When the water is cold, I like to use smaller lures. I\u2019ll keep the spinnerbaits under \u00bc oz. Color depends on water clarity. For muddy water, which is often the case after a spring rain, I\u2019ll choose bright colors like chartreuse or orange. If the water is stained, white is by far your most consistent color. For clear water, go with a clear skirt that has silver glitter, or choose a natural color like watermelon (dark green) or pumpkinseed (brown). You can add trailers to spinnerbaits in order to offer a little variety in color. For the blade design, I prefer a single colorado blade for cold water. It gives you the greatest amount of vibration possible. This is especially important if the water is stained or muddy. If the fish are very active, or if you need more flash, go to a colorado/willow tandem.</p>\n<p>\u00a0</p>\n<p>Thank to the City of Macon mo for your approval placing this cache</p>"
            }, 
