                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "Out geocaching today in Moberly and Macon.  I guess we were behind the CO on all of these.  Great timing.  Nice area.  Neat hide.  Great series!   Thanks for the cache and for bringing us here!"
                  }
