            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>City of Maple 3 Green<br />\nThe City of Maples series The town of Macon was first settled by James T. Haley in 1852. However, long before Mr. Haley's arrival, scores of immigrants from Kentucky and Virginia ventured into the region as early as 1829. In 1872, John Beaumont donated 10,000 young maple trees Because of these 10,000 trees, Macon has been named \"The City of Maples\". The city have seven beautiful and well maintained parks and lakes.</p>\n<p>\u00a0</p>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>series 3 of 10 caches. will be in the city parks or around the lakes., around long branch lakes. and some somewhere in the city.</p>\n<p>Quiet nice family small town park. Great park jest have fun with family</p>\n<p>Thank to the City of Macon mo for your approval placing this cache</p>"
            }, 
