            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>The City of Maples series The town of Macon was first settled by James T. Haley in 1852. However, long before Mr. Haley's arrival, scores of immigrants from Kentucky and Virginia ventured into the region as early as 1829. In 1872, John Beaumont donated 10,000 young maple trees Because of these 10,000 trees, Macon has been named \"The City of Maples\". This one in long branch state park.</p>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>series\u00a04 of 10 caches. will be in the city parks or around the lakes., around long branch lakes. and some somewhere in the city.</p>\n<p>Citizen involvement in hospital health care needs is a tradition that began with Mr. and Mrs. Gary in the late 1920s. The lack of modern hospital facilities in Macon County prompted the Garys to envision, build, and equip a hospital in Macon. In early 1943, the judges of Macon County Court signed an agreement to take over the management of the hospital, and the hospital was officially named Macon County Samaritan Memorial Hospital.</p>\n<p>Thank to\u00a0\u00a0Dr,Deline\u00a0 for your approval placing this cache<br />\n\u00a0</p>"
            }, 
