                    "#text": "OCW dphickey and Arthur of Arthur & Trillian on our way to Kirksville from Columbia. Signed most logs as TAD!\n\nVery shiny container. I'm surprised a raccoon hasn't taken it for a prize yet.\n\nThis entry was edited by Tony Banks on Sunday, 28 December 2014 at 05:10:38 UTC."
