                    "#text": "I was on a trip to look at a corn plot East of St. Louis today,with a little time to cache along the way. I usually go through Hannibal but decided to go a different route to add some counties in Missouri. \n\n\nThis was the highlight of the day - a few miles out of the way but I am certainly glad I made the trip. I love places like this that I would have never seen without geocaching.  It deserves and I'll give a favorite, though I still don't get the cache name.  I'll post some pics when I get home.  \n\nClever hide, one at a similar beacon but hidden differently in Madrid Iowa, if you ever get there stop by.  I prefer the hiding spot here.  \n\nGrabbed a TB, SL TFTC !"
