            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "The cache is a few feet off the trail. In the summer time you might have some bush wacking to get this cache log signed."
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>Charlie Brown Christmas tree- A Charlie brown Christmas was released on December 9th, 1965 and originally aired on CBS. The last date that A Charlie brown Christmas aired on CBS was Decembers 25th, 2000. The Next month the rights were sold to ABC and is currently aired in December.</p>\n<p>This cache is in Rothwell Park and is an easy find. It might just be the easiest cache you ever find. You will understand once you see it. Bring a pen. Could be used for small trade items. Please place back as you found it as you can see this one from the trail if you don't.\u00a0</p>\n<p>When Geocaching please respect and follow the rules of the park. The Park is open to the public daily from 5:00 a.m.-11:00 p.m. Do not damage any of the parks property, tress, or other wildlife. Hope you enjoy the park and its amenities.</p>\nCongratulations to Arthur and Trillian on FTF"
            }, 
