                    "@encoded": "False", 
                    "#text": "I sent a bunch of sixth graders this direction and when I went by, the end stage was gone! I think one of my kids took the first stage, too. So I replaced the whole dad gum cache. It could still use that official explanation paper, but it has a book and some prizes. Can't let my favorite cache die!  Tftc."
