            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "Over the last few years our family has had events of joy and sorrow that have called us back to the area. Every time, our extended family takes over this establishment\u00a0 and the common room at breakfast is more like the family kitchen on a holiday morning when everyone is home.<br />\n<br />\nOn this particular occasion, the subject of Geocaching had come up among a number of us and we had noticed that there was a shortage of caches within close proximity. This is our attempt to begin to remedy that issue.<br />\n<br />\n<br />\nOur Congratulations to Keynotes for the First To Find on this!.<br />\n<br />"
            }, 
