                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "Find # 0009012\nCounty: Randolph, Missouri\nDelorme Grid: MO-030\n\nDay 2 of my Midwest Journey to Geowoodstock XII from Des Moines, IA.  Today I started in Ottumwa, IA with some foggy weather and got into some rather stormy conditions as I made my way into Missouri.  Eventually I punched through a line of thunderstorms while moving west from Edina to Kirksville.  The rest of the day was quite delightful and the weather kept getting better and better before ending in Columbia, MO.  Most of my good friends going to GWS were well on their way to the event and I had hoped to see some on the journey, but I wound up not crossing paths with anyone though I evidently crossed paths with some of my Maryland friends near Macon or Moberly today.  Lots of fun caches to be had today!\n\nTypical P&G style of cache.  Not a whole lot happening in the immediate vicinity during my mid-afternoon visit."
                  }
