                    "#text": "I had found the previous cache here and wanted to take a stab at this one while I was passing through today. The cache was sitting out in plain sight, and I saw it from quite a distance as I was walking up the lane. I signed the log and placed it back where it appears it should go and a little more out of sight. TFTC!"
