                    "@encoded": "False", 
                    "#text": "TFTC. SL.  Wow, what a weekend.  I planned to fill the last few Jasmer spots (the ones within 400 miles) and accomplished that goal.  Now I only have 5 to go, but they will have to wait.  Also, filled a couple more dates on the calendar and added a few more counties in north central Missouri to the map.  Drove over 700 miles through rain, snow and sun, but it was all worth it for the joy of more smilies!  Thanks to all the CO\u2019s for creating and maintaining these hides for my enjoyment, especially the old ones!  Cache on!\n\nAnother quick find, another MO county.  Thanks!!"
